INSERT INTO `jalur_masuks` (`id`, `nama`, `deskripsi`, `biaya`, `jumlah_pendaftar`, `jumlah_maks_pendaftar`, `status`, `created_at`, `updated_at`) VALUES
(5, 'Jalur TES', '<p>Jalur Tes Mandiri di STKIP PGRI Bangkalan</p>', 250000, 26, 100, 'aktif', NULL, '2024-04-24 03:24:52'),
(7, 'Jalur Prestasi - Non Tes', '<p>Jalur ini dikhususkan untuk Calon Mahasiswa yang memiliki prestasi baik dibidang Akademik maupun Non Akademik yang dibuktikan dengan mengupload <strong>Serifikat Prestasi.</strong></p>\r\n\r\n<p>Benefit yang diperoleh :</p>\r\n\r\n<p>- Untuk Prestasi Tingkat Lokal Diskon 25% Biaya Komponen</p>\r\n\r\n<p>- Untuk Prestasi Tingkat Nasional Diskon 50% Biaya Komponen</p>\r\n\r\n<p>- Untuk Prestasi Tingkat Internasional Gratis Biaya Komponen</p>', 250000, 6, 35, 'aktif', '2024-04-24 03:20:58', '2024-04-24 03:41:10'),
(8, 'Jalur Registrasi Utama - Non Tes', '<p>Jalur ini diperuntukkan bagi Calon Mahasiswa yang <strong>Wajib</strong> melakukan Registrasi Ualng lebih awal yaitu dengan waktu 1 minggu setelah pengumuman hasil seleksi Calon Mahasiswa Baru diumumkan.</p>\r\n\r\n<p>Jalur ini mempunyai Benefit yaitu mendapatkan <strong>Gratis <em>Notebook</em></strong><strong>.</strong></p>\r\n\r\n<p>&nbsp;</p>', 250000, 12, 35, 'aktif', '2024-04-24 03:22:32', '2024-04-24 04:21:02'),
(9, 'Jalur Putra/putri PGRI - Non Tes', '<p>Jalur ini diperuntukkan bagi Calon Mahasiswa yang orangtuanya berprofesi sebagai Guru yang beranggotakan PGRI, yang dibuktikan dengan mengupload <strong>Kartu PGRI</strong> milik orangtuanya.</p>\r\n\r\n<p>Jalur ini mempunyai Benefit yaitu <strong>Diskon 30% SPP Selama 8 Semester.</strong></p>', 250000, 14, 70, 'aktif', '2024-04-24 03:23:04', '2024-04-24 03:47:39'),
(10, 'Jalur Putra/putri Guru - Non Tes', '<p>Jalur ini diperuntukkan bagi Calon Mahasiswa yang orangtuanya berprofesi sebagai Guru, yang dibuktikan dengan mengupload <strong>SK Kerja</strong>&nbsp;milik orangtuanya.</p>\r\n\r\n<p>Jalur ini mempunyai Benefit yaitu <strong>Diskon 10% SPP Selama 8 Semester.</strong></p>', 250000, 4, 35, 'aktif', '2024-04-24 03:23:33', '2024-04-24 03:50:20'),
(11, 'Jalur Santri dan Santriwati - Non Tes', '<p>Jalur ini diperuntukkan bagi Calon Mahasiswa yang berstatus sebagai Santri / Santriwati di pondok pesantren, yang dibuktikan dengan mengupload <strong>Kartu Santri</strong>&nbsp;atau <strong>Surat Keternagan dari pondok</strong>.</p>\r\n\r\n<p>Jalur ini mempunyai Benefit yaitu <strong>Diskon 50% SPP 1 Semester.</strong></p>', 250000, 13, 70, 'aktif', '2024-04-24 03:24:07', '2024-04-24 03:52:48'),
(12, 'Jalur SNPMB - Non Tes', '<p>Jalur ini diperuntukkan bagi Calon Mahasiswa yang gagal mengikuti seleksi kampus Negeri / SNPMB, yang dibuktikan dengan mengupload <strong>Kartu Peserta SNPMB</strong>.</p>\r\n\r\n<p>Jalur ini mempunyai Benefit yaitu <strong>Diskon 25% DPP.</strong></p>', 250000, 9, 140, 'aktif', '2024-04-24 03:24:41', '2024-04-24 03:55:13'),
(13, 'Jalur MOU - Non Tes', '<p>Jalur ini diperuntukkan bagi Calon Mahasiswa yang sekolahnya telah melakukan kerjasama / MOU dengan kampus kami STKIP PGRI Bangkalan, yang dibuktikan dengan mengupload <strong>Scan Berkas MOU.</strong></p>\r\n\r\n<p>Jalur ini mempunyai Benefit yaitu <strong>Diskon 50% DPP.</strong></p>', 250000, 7, 35, 'aktif', '2024-04-24 03:26:19', '2024-04-24 03:57:35'),
(14, 'Jalur KIP - Non Tes', NULL, 250000, 81, 100, 'aktif', '2024-04-24 03:27:18', '2024-04-24 03:27:18'),
(15, 'Program S1 Rekognisi Pembelajaran Lampau (RPL)', '<p>Program percepatan kuliah dengan persyaratan wajib yaitu ijazah SMA/Sederajat dan dengan Pengalaman Kerja minimal 2 tahun, yang dibuktikan dengan mengupload&nbsp;<strong>SK Kerja.</strong></p>', 250000, 24, 100, 'aktif', '2024-04-24 03:31:20', '2024-04-24 04:18:24');
